window.bookSummaryJSON = "<p><b>My Savior...Or My Ruin? </b></p> <p>One night, and my entire life went up in flames. All because of him. Jafar. As my world burned down around me, he offered me a choice. Walk away with nothing but my freedom...or rise to his challenge and win my fortune back. </p> <p>I bargained. </p> <p>I lost. </p> <p>Now Jafar owns me, and even as my mind rails against his rules, my body loves the punishments he deals out when I break them. </p> <p>But a gilded cage is still a prison, I’ll do anything to obtain my freedom. </p> <p>Even betray the man I’m falling for. </p> <p>Content Warning: This book contains depictions of consensual non-consent.</p>"; 
